import pig from './images/landImg.png'


function Landing() {
    return (
        <div classNameName='text-center'>
            <figure classNameName="figure text-center">
                <img src={pig} classNameName="figure-img img-fluid text-center pig" alt="pig logo"></img>
            </figure>
        </div>
    )
}





export default Landing;
